from django.db import modelsfrom apps.account.models import Accountclass ServiceModel(models.Model):    service_name = models.CharField(max_length=255)    price = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="logus_service", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_logus_service", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.service_name} - {self.price}"